Job Description 

Sales:
• Coordinate actions with the store management team so when in absence can ensure the continuity and the good functioning of store operations; 
• Greet customers, answer their questions and advise them on the technical features, advantages, quality and materials of the merchandise; 
• Train employees on best sales techniques and product knowledge; 
• Reach personal sales objectives; 
• Communicate all necessary information to the team so they can achieve the sales objectives established by the management team; 
• Follow administrative procedures and policies.

Responsibilities
	•	Assist survey manager in all aspects of project delivery;
	•	Conduct quality control checks of design drawings;
	•	Prepare & design alignment, profiles, sections, corridors using AutoCAD Civil3D
	•	Prepare quantity and cost estimates;
	•	Prepare technical construction specifications
	•	Create CAD drawings from concept to final design

your responsibilities
	•	Be part of a team responsible for the electrical design, conditioning and electrical systems support of the cockpit flight simulator;
	•	Assist in the analysis of drawings, specifications and requirements from both internal/external customers;
	•	Assist in defining the simulator hardware configuration, produce equipment lists, wiring diagram and electrical system schematics required to stimulate this equipment in a simulation environment;


our requirements
	•	Bachelors in Electrical Engineering or equivalent;
	•	Strong knowledge of electrical engineering concepts;
	•	Good working knowledge of CAO systems and word processing/spreadsheet softwares;
	•	Good technical writing and communication skills;
	•	Experience with electrical, avionic and power systems;

Qualifications

What You Should Have:
	•	Bachelors degree in Civil Engineering;
	•	At least 7+ years experience in design of structural steel, pre-stressed and reinforced concrete bridges and bridge rehabilitation;
	•	Experience with MTO projects is preferred;
	•	PEO Licensed P.Eng preferred;
	•	Conversant with CHBDC (CAN S-6) and the MTO Structural Manual;
	•	Effective communication skills in the English language (verbal and written);

Key requirements
	•	High school education;
	•	Previous customer service experience preferred;
	•	Positive attitude and a strong desire to provide excellent customer service;
	•	Must be able to effectively communicate with shoppers, retailers, centre Management, Service Providers and all of the shopping centre personnel;
	•	Must be able to work in a fast-paced environment, with the ability to multi-task while maintaining a high level of professionalism;
	•	Strong written and oral communication skills, multilingual skills a plus;
	•	Conflict resolution/management skills;
